import React from 'react';

const Products = () => {
  const containerStyle = {
    textAlign: 'center',
  };

  const imageContainerStyle = {
    display: 'flex',
    justifyContent: 'center',
    flexWrap: 'wrap',
  };

  const imageStyle = {
    margin: '10px',
  };

  const renderImages = (count) => {
    const images = [];
    for (let i = 1; i <= count; i++) {
      images.push(
        <div key={i} style={imageStyle}>
          <img
            src={`/Images_page-000${i}.jpg`}
            alt={`Tree ${i}`}
          />
          <p>$50.00</p>
        </div>
      );
    }
    return images;
  };

  return (
    <div style={containerStyle}>
      <h1>Hello from Products</h1>
      <div style={imageContainerStyle}>
        {renderImages(4)}
        
        < img src='/Image 5_page-0001.jpg'></img>
      </div>

      <div style={imageContainerStyle}>
        {renderImages(7)} {/* Display the remaining images below */}
      </div>
    </div>
  );
};

export default Products;
